import React from "react";
import { Route } from "react-router-dom";
import ProtectedRoute from "../auth/ProtectedRoute";

// Civilian Pages
import CivilianDashboard from "../pages/civilian/Dashboard";
import MyCases from "../pages/civilian/MyCases";
import NewCaseForm from "../pages/civilian/NewCaseForm";
import EvidenceUpload from "../pages/civilian/EvidenceUpload";
import Payments from "../pages/civilian/Payments";
import CaseStatus from "../pages/civilian/CaseStatus";
import CaseDetails from "../pages/civilian/CaseDetails";
import HearingSchedule from "../pages/civilian/HearingSchedule";
import Documents from "../pages/civilian/Documents";

export default function CivilianRoutes() {
  return (
    <>
      <Route
        path="/civilian"
        element={
          <ProtectedRoute>
            <CivilianDashboard />
          </ProtectedRoute>
        }
      />
      <Route
        path="/civilian/my-cases"
        element={
          <ProtectedRoute>
            <MyCases />
          </ProtectedRoute>
        }
      />
      <Route
        path="/civilian/new-case"
        element={
          <ProtectedRoute>
            <NewCaseForm />
          </ProtectedRoute>
        }
      />
      <Route
        path="/civilian/evidence"
        element={
          <ProtectedRoute>
            <EvidenceUpload />
          </ProtectedRoute>
        }
      />
      <Route
        path="/civilian/payments"
        element={
          <ProtectedRoute>
            <Payments />
          </ProtectedRoute>
        }
      />
      <Route
        path="/civilian/case-status"
        element={
          <ProtectedRoute>
            <CaseStatus />
          </ProtectedRoute>
        }
      />
      <Route
        path="/civilian/cases/:id"
        element={
          <ProtectedRoute>
            <CaseDetails />
          </ProtectedRoute>
        }
      />
      <Route
        path="/civilian/hearings"
        element={
          <ProtectedRoute>
            <HearingSchedule />
          </ProtectedRoute>
        }
      />
      <Route
        path="/civilian/documents"
        element={
          <ProtectedRoute>
            <Documents />
          </ProtectedRoute>
        }
      />
    </>
  );
}
